import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import MenuItemList from './components/MenuItemList';

const App = () => {
  return (
    <Router>
      <div>
        <Routes>
          <Route exact path="/" component={MenuItemList} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
